import { format } from 'date-fns';

export const generateDataFilenameByDate = (date: string) => {
    const formattedDate = format(new Date(date), 'yyyy-MM-dd'); // Ensure it's yyyy-MM-dd
    return `${formattedDate}.json`;
};
